import React, {useState} from 'react'

import {
    Button,
    Table,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu,
    
    TablePagination
    
    
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'


const Import = (props) => {
    // fill out this component
    // console.log(props)
// *pagination
const [page, setPage] = React.useState(2);
const [rowsPerPage, setRowsPerPage] = React.useState(10);

const handleChangePage = (
    event: React.MouseEvent<HTMLButtonElement> | null,
    newPage: number,
  ) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (
    event: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>,
  ) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };




    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    }
    const handleClose = () => {
        setAnchorEl(null);
      };
    const [deleteMakes] = useState(null);

    const handleDeletes = (index) => {
        props.deleteMakes(deleteMakes, index)
        setAnchorEl(null);
    }

    return (
      
        <Container>
              <br />
              <br />
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            <h2> Count: {props.makes.length}</h2>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {props.makes.map((makes, index) => (
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            <MoreVertIcon onClick={handleClick} />
                         
                            <Menu   
                                    id="basic-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                 
                                    
                                >
                                    <MenuItem onClick={handleDeletes}>Delete</MenuItem>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu>
                                                        
                         </TableCell>   
                    </TableRow>
            ))}
            </TableBody>
        </Table>
        <TablePagination
      component="div"
      count={100}
      page={page}
      onPageChange={handleChangePage}
      rowsPerPage={rowsPerPage}
      onRowsPerPageChange={handleChangeRowsPerPage}
    />
   
 
    
    </Container>
        
    )
}

export default Import
